import { faFacebook, faInstagram } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const MediaSocial = (props) => (
  <>
    <FontAwesomeIcon icon={faFacebook} size="2.5x" transform="down-4 grow-5.5" className={'mb-0 mt-12 mx-auto'}/>
    <FontAwesomeIcon icon={faInstagram} className={'mb-0 mt-12 mx-auto'}/>
  </>
);

export default MediaSocial
